import { useState } from 'react'
import Header from './components/Header';
import Events from './components/Events';
import Event from './models/model.event.ts';

const App: React.FC = () => {


  const [events, setEvents] = useState<Event[]>([
    {
        id: 1,
        text: 'Example 1',
        date: '01/02/2023'    
    },
    {
        id: 2,
        text: 'Example 2',
        date: '01/03/2023'    
    },
    {
        id: 3,
        text: 'Example 3',
        date: '01/24/2023'    
    }
])

  return (
    <div className="App">
      <Header />
    </div>
  );
}

export default App;
